START TRANSACTION;
CREATE TABLE IF NOT EXISTS `CLIENT` (
	`numClient`	TEXT,
	`nomClient`	TEXT,
	`prénomClient`	TEXT,
	`adresseRueClient`	TEXT,
	`cpClient`	NUMERIC,
	`adrVilleClient`	TEXT,
	`mailClient`	TEXT,
	`telClient`	NUMERIC
);
CREATE TABLE IF NOT EXISTS `SEJOUR` (
	`CodeSéjour`	TEXT,
	`LibelléSéjour`	TEXT
);
CREATE TABLE IF NOT EXISTS `RESERVER` (
	`numClient`	TEXT,
	`CodeSéjour`	TEXT,
	`DateDébutSéjour`	DATETIME
);
CREATE TABLE IF NOT EXISTS `PLANIFIER` (
	`numClient`	TEXT,
	`dateSoin`	DATETIME,
	`codeSoin`	TEXT,
	`heureSoin`	TEXT,
	`numPersonnel`	NUMERIC
);
CREATE TABLE IF NOT EXISTS `SOIN` (
	`codeSoin`	TEXT,
	`libelléSoin`	TEXT,
	`duréeSoin`	NUMERIC,
	`codeSalon`	NUMERIC
);
CREATE TABLE IF NOT EXISTS `SALON` (
	`codeSalon`	INTEGER AUTO_INCREMENT,
	`libelléSalon`	TEXT,
	`nombreCabines`	NUMERIC,
	PRIMARY KEY(`codeSalon`)
);
CREATE TABLE IF NOT EXISTS `PERSONNEL` (
	`numPersonnel`	INTEGER AUTO_INCREMENT,
	`nomPersonnel`	TEXT,
	`prénomPersonnel`	TEXT,
	`codeSalon`	NUMERIC,
	PRIMARY KEY(`numPersonnel`)
);
COMMIT;
